import React, { useState } from 'react';
import { ExternalLink, Clock, User } from 'lucide-react';

/* ===================== STATIC DATA ===================== */
const PROJECTS = [
  {
    id: 1,
    title: 'NeXLet Agency Website',
    category: 'Web Development',
    description: 'Official NeXLet agency website built with modern UI and responsive design.',
    image: 'https://images.unsplash.com/photo-1498050108023-c5249f4df085',
    link: 'https://nexlet.vercel.app',
    client: 'NeXLet',
    duration: '2 Weeks',
    tech: ['React', 'Tailwind', 'FastAPI'],
  },
  {
    id: 2,
    title: 'Business Landing Page',
    category: 'Landing Page',
    description: 'High-conversion landing page for a startup business.',
    image: 'https://images.unsplash.com/photo-1519337265831-281ec6cc8514',
    client: 'Startup Client',
    duration: '5 Days',
    tech: ['HTML', 'CSS', 'JavaScript'],
  },
  {
    id: 3,
    title: 'Mobile App UI Design',
    category: 'UI/UX Design',
    description: 'Modern UI/UX design for a mobile application.',
    image: 'https://images.unsplash.com/photo-1559028012-481c04fa702d',
    client: 'Design Studio',
    duration: '1 Week',
    tech: ['Figma', 'UI Design'],
  },
  {
    id: 4,
    title: 'Portfolio Website',
    category: 'Web Development',
    description: 'Personal portfolio website with smooth animations.',
    image: 'https://images.unsplash.com/photo-1522202176988-66273c2fd55f',
    client: 'Freelancer',
    duration: '4 Days',
    tech: ['React', 'CSS'],
  },
];

/* ===================== COMPONENT ===================== */
function Portfolio() {
  const [active, setActive] = useState('All');

  const categories = ['All', 'Web Development', 'UI/UX Design', 'Landing Page'];

  const visibleProjects =
    active === 'All'
      ? PROJECTS
      : PROJECTS.filter(p => p.category === active);

  return (
    <section
      id="portfolio"
      className="py-24 px-4 bg-gradient-to-b from-black via-gray-900 to-black"
    >
      <div className="max-w-7xl mx-auto">

        {/* Header */}
        <div className="text-center mb-14">
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-4">
            Our Portfolio
          </h2>
          <p className="text-lg text-gray-400">
            Explore our recent projects and see how we bring ideas to life
          </p>
        </div>

        {/* Filters */}
        <div className="flex justify-center flex-wrap gap-4 mb-16">
          {categories.map(cat => (
            <button
              key={cat}
              onClick={() => setActive(cat)}
              className={`px-6 py-2 rounded-full text-sm font-medium transition-all
                ${
                  active === cat
                    ? 'bg-blue-500 text-white shadow-lg shadow-blue-500/40'
                    : 'bg-white/5 text-gray-400 hover:bg-white/10 hover:text-white'
                }
              `}
            >
              {cat}
            </button>
          ))}
        </div>

        {/* Grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-10">
          {visibleProjects.map(project => (
            <div
              key={project.id}
              className="bg-white/5 border border-white/10 rounded-xl overflow-hidden
                         hover:scale-105 transition-transform duration-300"
            >
              {/* Image */}
              <div className="relative h-52">
                <img
                  src={project.image}
                  alt={project.title}
                  className="w-full h-full object-cover"
                />

                {project.link && (
                  <a
                    href={project.link}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="absolute top-4 right-4 bg-black/60 p-2 rounded-full
                               hover:bg-black/80"
                  >
                    <ExternalLink className="w-5 h-5 text-white" />
                  </a>
                )}

                <span className="absolute top-4 left-4 bg-blue-500 text-white
                                 text-xs px-3 py-1 rounded-full">
                  {project.category}
                </span>
              </div>

              {/* Content */}
              <div className="p-6">
                <h3 className="text-xl font-semibold text-white mb-2">
                  {project.title}
                </h3>

                <p className="text-gray-400 text-sm mb-4">
                  {project.description}
                </p>

                {/* Meta */}
                <div className="flex gap-4 text-xs text-gray-500 mb-4">
                  <span className="flex items-center gap-1">
                    <User className="w-3 h-3" />
                    {project.client}
                  </span>
                  <span className="flex items-center gap-1">
                    <Clock className="w-3 h-3" />
                    {project.duration}
                  </span>
                </div>

                {/* Tech */}
                <div className="flex flex-wrap gap-2">
                  {project.tech.map((t, i) => (
                    <span
                      key={i}
                      className="text-xs px-2 py-1 rounded
                                 bg-white/5 text-gray-400 border border-white/10"
                    >
                      {t}
                    </span>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>

      </div>
    </section>
  );
}

export default Portfolio;
